import React, { useEffect, useState } from 'react';
import { motion } from 'framer-motion';

const Cat = () => {
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });
  const [catPosition, setCatPosition] = useState({ x: window.innerWidth / 2, y: window.innerHeight / 2 });
  const [isCurled, setIsCurled] = useState(false);
  const [isVisible, setIsVisible] = useState(false);

  useEffect(() => {
    const handleMouseMove = (e) => {
      setMousePosition({ x: e.clientX, y: e.clientY });
      setIsVisible(true);
    };

    const handleMouseLeave = () => {
      setIsVisible(false);
    };

    window.addEventListener('mousemove', handleMouseMove);
    window.addEventListener('mouseleave', handleMouseLeave);

    return () => {
      window.removeEventListener('mousemove', handleMouseMove);
      window.removeEventListener('mouseleave', handleMouseLeave);
    };
  }, []);

  useEffect(() => {
    const moveInterval = setInterval(() => {
      setCatPosition((prev) => {
        const dx = mousePosition.x - prev.x;
        const dy = mousePosition.y - prev.y;
        const distance = Math.sqrt(dx * dx + dy * dy);

        // If cat is close to cursor (within 30px), curl up
        if (distance < 30) {
          if (!isCurled) {
            setIsCurled(true);
          }
          return prev; // Stop moving when curled
        } else {
          // If cursor moves away, uncurl and start following again
          if (isCurled && distance > 50) {
            setIsCurled(false);
          }

          // Move slowly towards cursor (5% of distance each frame)
          const moveSpeed = 0.05;
          return {
            x: prev.x + dx * moveSpeed,
            y: prev.y + dy * moveSpeed
          };
        }
      });
    }, 50); // Update every 50ms for smooth movement

    return () => clearInterval(moveInterval);
  }, [mousePosition, isCurled]);

  return (
    <motion.div
      className="cat-container"
      animate={{
        x: catPosition.x - 30,
        y: catPosition.y - 30,
        opacity: isVisible ? 1 : 0.5,
        scale: isCurled ? 0.8 : 1,
        rotate: isCurled ? 0 : 0
      }}
      transition={{
        type: "spring",
        stiffness: 50,
        damping: 20,
        mass: 1
      }}
    >
      <div className={`cat ${isCurled ? 'curled' : ''}`}>
        {isCurled ? (
          <svg
            width="60"
            height="60"
            viewBox="0 0 60 60"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
          >
            {/* Curled up cat */}
            <circle cx="30" cy="30" r="25" fill="var(--muted-pink-2)" opacity="0.8" />
            <circle cx="25" cy="25" r="3" fill="var(--dark-gray-1)" />
            <circle cx="35" cy="25" r="3" fill="var(--dark-gray-1)" />
            <ellipse cx="30" cy="32" rx="4" ry="2" fill="var(--dark-gray-1)" />
            <path d="M 20 35 Q 30 40 40 35" stroke="var(--dark-gray-1)" strokeWidth="1.5" fill="none" />
            <path d="M 30 30 Q 25 20 20 25" stroke="var(--muted-pink-3)" strokeWidth="2" fill="none" />
            <path d="M 30 30 Q 35 20 40 25" stroke="var(--muted-pink-3)" strokeWidth="2" fill="none" />
          </svg>
        ) : (
          <svg
            width="60"
            height="60"
            viewBox="0 0 60 60"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
          >
            {/* Walking cat */}
            <ellipse cx="30" cy="35" rx="20" ry="15" fill="var(--muted-pink-2)" opacity="0.8" />
            <circle cx="30" cy="30" r="12" fill="var(--muted-pink-2)" opacity="0.8" />
            <circle cx="25" cy="28" r="2.5" fill="var(--dark-gray-1)" />
            <circle cx="35" cy="28" r="2.5" fill="var(--dark-gray-1)" />
            <ellipse cx="30" cy="32" rx="3" ry="2" fill="var(--dark-gray-1)" />
            <path d="M 22 25 L 20 20" stroke="var(--muted-pink-3)" strokeWidth="2" strokeLinecap="round" />
            <path d="M 38 25 L 40 20" stroke="var(--muted-pink-3)" strokeWidth="2" strokeLinecap="round" />
            <path d="M 15 38 L 18 42" stroke="var(--muted-pink-3)" strokeWidth="2" strokeLinecap="round" />
            <path d="M 25 42 L 25 45" stroke="var(--muted-pink-3)" strokeWidth="2" strokeLinecap="round" />
            <path d="M 35 42 L 35 45" stroke="var(--muted-pink-3)" strokeWidth="2" strokeLinecap="round" />
            <path d="M 45 38 L 42 42" stroke="var(--muted-pink-3)" strokeWidth="2" strokeLinecap="round" />
            <path d="M 20 30 Q 15 25 10 30" stroke="var(--muted-pink-3)" strokeWidth="2" fill="none" />
            <path d="M 40 30 Q 45 25 50 30" stroke="var(--muted-pink-3)" strokeWidth="2" fill="none" />
          </svg>
        )}
      </div>
    </motion.div>
  );
};

export default Cat;
